import QuoteList from '../components/quotes/QuoteList'

const DUMMY_QUOTES = [
    {id: 'q1', author: 'Guido', text:'Learning react is Fun'},
    {id: 'q2', author: 'Eduardo', text:'Learning react is great'}
]

const AllQuotes = () => {
    return <QuoteList quotes={DUMMY_QUOTES}/>
};


export default AllQuotes;
